sections:
  - name: IPFILTER_CACHE ASSIGN - TENANT IPV6
    elements:
      - name: VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_TCP
        references:
          - PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_TCP
          - PLH_VAR_IPFILTER_CACHE
          - PLH_VAR_IPFILTER_TENANT_IPV6_TCP_CACHE_KEY
          - PLH_IPV6_SRC_128
          - PLH_RSP_VAR_IPFILTER_TENANT_IPV6_TCP_ASSIGN
          - PLH_LBV_IPFILTER_TENANT_HTTP
        dependencies:
          - VAR_IPFILTER_CACHE
          - LBV_IPFILTER_TENANT_HTTP
        expressions:
          install: |
            add ns assignment PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_TCP -variable q{$PLH_VAR_IPFILTER_CACHE[PLH_VAR_IPFILTER_TENANT_IPV6_TCP_CACHE_KEY]} -set q{PLH_IPV6_SRC_128}
            add responder policy PLH_RSP_VAR_IPFILTER_TENANT_IPV6_TCP_ASSIGN q{!CLIENT.IPV6.SRC.IS_IPV4} PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_TCP
            bind lb vserver PLH_LBV_IPFILTER_TENANT_HTTP -policyName PLH_RSP_VAR_IPFILTER_TENANT_IPV6_TCP_ASSIGN -priority 10200 -gotoPriorityExpression NEXT
            bind lb vserver PLH_LBV_IPFILTER_TENANT_TCP -policyName PLH_RSP_VAR_IPFILTER_TENANT_IPV6_TCP_ASSIGN -priority 10200 -gotoPriorityExpression NEXT
          uninstall: |
            unbind lb vserver PLH_LBV_IPFILTER_TENANT_TCP -policyName PLH_RSP_VAR_IPFILTER_TENANT_IPV6_TCP_ASSIGN
            unbind lb vserver PLH_LBV_IPFILTER_TENANT_HTTP -policyName PLH_RSP_VAR_IPFILTER_TENANT_IPV6_TCP_ASSIGN
            rm responder policy PLH_RSP_VAR_IPFILTER_TENANT_IPV6_TCP_ASSIGN
            rm ns assignment PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_TCP

      - name: VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_UDP
        references:
          - PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_UDP
