          - PLH_IPV6_SRC_128
          - PLH_RSP_VAR_IPFILTER_TENANT_IPV6_UDP_ASSIGN
          - PLH_LBV_IPFILTER_TENANT_HTTP
        dependencies:
          - VAR_IPFILTER_CACHE
          - LBV_IPFILTER_TENANT_HTTP
        expressions:
          install: |
            add ns assignment PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_UDP -variable q{$PLH_VAR_IPFILTER_CACHE[PLH_VAR_IPFILTER_TENANT_IPV6_UDP_CACHE_KEY]} -set q{PLH_IPV6_SRC_128}
            # TODO - UDP FILTER POLICY INSTEAD OF RESPONDER ? - add responder policy PLH_RSP_VAR_IPFILTER_TENANT_IPV6_UDP_ASSIGN q{!CLIENT.IPV6.SRC.IS_IPV4} PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_UDP
            # TODO - UDP FILTER POLICY INSTEAD OF RESPONDER ? - bind lb vserver PLH_LBV_IPFILTER_TENANT_UDP -policyName PLH_RSP_VAR_IPFILTER_TENANT_IPV6_UDP_ASSIGN -priority 10200 -gotoPriorityExpression NEXT
          uninstall: |
            # TODO - UDP FILTER POLICY INSTEAD OF RESPONDER ? - unbind lb vserver PLH_LBV_IPFILTER_TENANT_UDP -policyName PLH_RSP_VAR_IPFILTER_TENANT_IPV6_UDP_ASSIGN
            # TODO - UDP FILTER POLICY INSTEAD OF RESPONDER ? - rm responder policy PLH_RSP_VAR_IPFILTER_TENANT_IPV6_UDP_ASSIGN
            rm ns assignment PLH_VAR_IPFILTER_CACHE_TENANT_ASSIGN_IPV6_UDP



